/*****************************************************************************
 结构名    : REG_PD_TCPC_CTRL_UNION
 结构说明  : PD_TCPC_CTRL 寄存器结构定义。地址偏移量:0x19，初值:0x00，宽度:8
 寄存器说明: PD TCPC Control
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  pd_orient            : 1;  /* bit[0-0]: CC1/CC2通路选择配置寄存器。每次连接建立时，TCPC上报CC1/CC2连接中断，TCPM均需要滤抖tCCDebounce时间后判断方向重新配置pd_orient（即便方向与原设置一致仍需重新配置）
                                                               0b：选择CC1为通信通路，检测CC1是否有通信发生。当Vconn有效则置于CC2通路；
                                                               1b：选择CC2为通信通路，检测CC2是否有通信发生。当Vconn有效则置于CC1通路；
                                                               默认0 */
        unsigned char  pd_bist_mode         : 1;  /* bit[1-1]: BIST模式配置寄存器。设置为1主要用于USB兼容性测试仪测试PD物理层。当连接断开，TCPM需要写该比特为0。
                                                               0b:正常模式，PD_RXDETECT寄存器所使能检测的SOP* msg会通过中断方式告知TCPM。
                                                               1b：BIST测试模式，PD_RXDETECT寄存器所使能检测的SOP* msg不会通过中断方式告知TCPM。TCPC自身会自动存储收到的msg、校验CRC，回复GoodCRC。其中，不会置位PD_ALERT_L的pd_int_rxstat，但有可能置位PD_ALERT_H的pd_int_rx_full
                                                               默认0 */
        unsigned char  reserved_0           : 2;  /* bit[2-3]: I2C_CLK_STRECTH功能不支持。因此reserved */
        unsigned char  pd_debug_acc_ctrl    : 1;  /* bit[4-4]: Debug Accessory控制寄存器
                                                               0b：由TCPC自动控制进入与退出；
                                                               1b：有TCPM控制，当设置为1，若TCPC处于Debug模式，则退出Debug模式；若TCPC不处于Debug模式，则不可进入Debug模式，接收不到VDM命令；
                                                               默认0 */
        unsigned char  reserved_1           : 1;  /* bit[5-5]: Enable Watchdog Timer功能不支持，看门狗统一由系统看门狗集成，不在PD协议中体现。 */
        unsigned char  pd_en_look4con_alert : 1;  /* bit[6-6]: pd_look4con状态变化上报pd_int_ccstatus中断的使能比特。
                                                               0b：当pd_look4con比特状态变化时不上报pd_int_ccstatus中断；
                                                               1b: 当pd_look4con比特状态变化时上报pd_int_ccstatus中断。
                                                               
                                                               除非TCPM设置该比特为1，TCPC默认在pd_look4con状态发生变化时，需要屏蔽中断pd_int_ccstatus上报。 */
        unsigned char  reserved_2           : 1;  /* bit[7-7]: reserved */
    } reg;
} REG_PD_TCPC_CTRL_UNION;
#endif
#define REG_PD_TCPC_CTRL_pd_orient_START             (0)
#define REG_PD_TCPC_CTRL_pd_orient_END               (0)
#define REG_PD_TCPC_CTRL_pd_bist_mode_START          (1)
#define REG_PD_TCPC_CTRL_pd_bist_mode_END            (1)
#define REG_PD_TCPC_CTRL_pd_debug_acc_ctrl_START     (4)
#define REG_PD_TCPC_CTRL_pd_debug_acc_ctrl_END       (4)
#define REG_PD_TCPC_CTRL_pd_en_look4con_alert_START  (6)
#define REG_PD_TCPC_CTRL_pd_en_look4con_alert_END    (6)


