/*****************************************************************************
 结构名    : REG_PD_COMMAND_UNION
 结构说明  : PD_COMMAND 寄存器结构定义。地址偏移量:0x23，初值:0x00，宽度:8
 寄存器说明: PD Command
*****************************************************************************/
#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  pd_command : 8;  /* bit[0-7]: 命令寄存器，TCPM通过I2C接口对该寄存器配置为不同的值从而触发不同的命令。命令列表如下所示。
                                                     8'h11：WakeI2C，不支持；
                                                     8'h22：DisableVbusDetect，支持，关闭Vbus电压检测功能。当TCPC在sourcing或者sinking power的时候建议不关闭。
                                                     8'h33：EnableVbusDetect，支持，使能Vbus电压检测功能
                                                     8'h44：DisableSinkVbus，不支持，软件通过配置sc_ovp_mos_en寄存器为0来停止Sink Vbus；
                                                     8'h55：SinkVbus，不支持，软件通过配置sc_ovp_mos_en寄存器为1来使能Sink Vbus；
                                                     8'h66：DisableSourceVbus，不支持，软件通过配置关闭内部OTG使能（具体看otg编程指南部分）来停止Source Vbus
                                                     8'h77：SourceVbusDefaultVol，不支持，软件通过配置开启内部OTG使能（具体看otg编程指南部分）来Source Vbus；
                                                     8'h88：SourceVbusHighVol，不支持；
                                                     8'h99：Look4Connection，支持，当PD_ROLE_CTRL的pd_cc2_cfg/pd_cc1_cfg为双Rp或者双Rd，且pd_drp为1，则TCPC开始DRP Toggle，若条件不成立，则没有动作。
                                                     8'hAA：RxOneMore，支持，使得PD接收端在发送完下一次GoodCRC后自动清PD_RXDETECT寄存器。这便于在某一特定点可以关闭msg的接收，分包或RX FIFO的深度不限制该功能的使用。
                                                     其他：不支持 */
    } reg;
} REG_PD_COMMAND_UNION;
#endif
#define REG_PD_COMMAND_pd_command_START  (0)
#define REG_PD_COMMAND_pd_command_END    (7)


