#ifndef __SOC_H_FOR_ASM__
typedef union
{
    unsigned char      value;
    struct
    {
        unsigned char  sc_coul_clk_cali_en      : 1;  /* bit[0-0]: 库仑计低精度时钟芯片自修调触发。对该寄存器进行写入操作触发修调功能。
                                                                   
                                                                   库仑计在ECO与下电OCV的时候，芯片为节省功能会切换至低精度时钟，时钟频偏+/-40%，触发自修调功能后，芯片会使能AVDD，然后经过2ms校准测量后完成自修调功能，最后关闭AVDD。修调后预期误差为+/-8%
                                                                   
                                                                   修调后数值可通过寄存器coul_crg_cali_value回读。 */
        unsigned char  sc_coul_clk_cali_disable : 1;  /* bit[1-1]: 库仑计低精度时钟芯片自修调Diable寄存器
                                                                   0: 开启库仑计时钟自修调功能；
                                                                   1：关闭库仑计时钟自修调功能；
                                                                   默认0 */
        unsigned char  reserved                 : 6;  /* bit[2-7]: reserved */
    } reg;
} REG_COUL_CLK_CALI_EN_UNION;
#endif
